import React from 'react'

class FormReset extends React.Component{
    constructor(props){
        super(props)
        this.state={
            old_password: '',
            new_password: '',
            new_password_confirmation: ''
    }
    }   

    handleInputChange = (event) => {
            this.setState({
              [event.target.name]: event.target.value,
              errors: [],
            })
          }
    
    render(){
        return(
            <>
            <form>
                <div class="row">
                    <div class="col-md-6">
                        <label>Experience</label>
                    </div>
                    <div class="col-md-6">
                        <p>Expert</p>
                    </div>
                </div>
                <div class="row">
                    <div class="col-md-6">
                        <label>Hourly Rate</label>
                    </div>
                    <div class="col-md-6">
                        <p>10$/hr</p>
                    </div>
                </div>
           
                        <label htmlFor="new_password_confirmation">Total Projects</label>
                        <input type="text" id="new_password_confirmation" name="new_password_confirmation" placeholder="confirm password" onChange={this.handleInputChange} />
                   
                
            </form>
                
            </>
        )
    }
}
export default FormReset;
